      <NavBar />
      <div className="container">
        <div className="item">
          <img src="" alt="" />
          <p>opis</p>
          <div className="counter">
            <button>+</button>
            <p>1</p>
            <button>-</button>
          </div>
        </div>
      </div>
    </div>
  );
};

